oving traffic.", "type": "integer" }, "successThreshold": { "description": "Number of consecutive successful checks required before receiving traffic.", "type": "integer", "format": "uint32" }, "checkInterval": { "type": "string", "format": "google-duration", "description": "Interval between health checks." }, "host": { "description": "Host header to send when performing a HTTP Readiness check. Example: \"myapp.appspot.com\"", "type": "string" }, "timeout": { "type": "string", "format": "google-duration", "description": "Time before the check is considered failed." }, "appStartTimeout": { "description": "A maximum time limit on application initialization, measured from moment the application successfully replies to a healthcheck until it is ready to serve traffic.", "format": "google-duration", "type": "string" } }, "id": "ReadinessCheck", "description": "Readiness checking configuration for VM instances. Unhealthy instances are removed from traffic rotation." }, "CreateVersionMetadataV1Beta": { "id": "CreateVersionMetadataV1Beta", "type": "object", "properties": { "cloudBuildId": { "description": "The Cloud Build ID if one was created as part of the version create. @OutputOnly", "type": "string" } }, "description": "Metadata for the given google.longrunning.Operation during a google.appengine.v1beta.CreateVersionRequest." }, "CpuUtilization": { "type": "object", "id": "CpuUtilization", "description": "Target scaling by CPU usage.", "properties": { "targetUtilization": { "format": "double", "description": "Target CPU utilization ratio to maintain when scaling. Must be between 0 and 1.", "type": "number" }, "aggregationWindowLength": { "format": "google-duration", "description": "Period of time over which CPU utilization is calculated.", "type": "string" } } }, "LocationMetadata": { "type": "object", "id": "LocationMetadata", "description": "Metadata for the given google.cloud.location.Location.", "properties": { "standardEnvironmentAvailable": { "description": "App 