eld is used to give the configuration ID and is required in this case.Endpoints also has a rollout strategy called RolloutStrategy.MANAGED. When using this, Endpoints fetches the latest configuration and does not need the configuration ID. In this case, config_id must be omitted." }, "name": { "description": "Endpoints service name which is the name of the \"service\" resource in the Service Management API. For example \"myapi.endpoints.myproject.cloud.goog\"", "type": "string" } }, "type": "object", "id": "EndpointsApiService" }, "Instance": { "id": "Instance", "description": "An Instance resource is the computing unit that App Engine uses to automatically scale an application.", "properties": { "vmDebugEnabled": { "readOnly": true, "type": "boolean", "description": "Output only. Whether this instance is in debug mode. Only applicable for instances in App Engine flexible environment." }, "vmZoneName": { "type": "string", "description": "Output only. Zone where the virtual machine is located. Only applicable for instances in App Engine flexible environment.", "readOnly": true }, "vmId": { "type": "string", "description": "Output only. Virtual machine ID of this instance. Only applicable for instances in App Engine flexible environment.", "readOnly": true }, "requests": { "format": "int32", "description": "Output only. Number of requests since this instance was started.", "readOnly": true, "type": "integer" }, "averageLatency": { "type": "integer", "format": "int32", "description": "Output only. Average latency (ms) over the last minute.", "readOnly": true }, "startTime": { "format": "google-datetime", "description": "Output only. Time that this instance was started.@OutputOnly", "readOnly": true, "type": "string" }, "name": { "readOnly": true, "description": "Output only. Full path to the Instance resource in the API. Example: apps/myapp/services/default/versions/v1/instances/instance-1.", "type": "string" }, "vmLiveness": { "readOnly": true, "type": "string", "desc